textOriginal:
Brasil é a Nação, cujo DEUS Vivo é o SENHOR JESUS CRISTO
 *  *  * 
Palavra da Boca de DEUS Vivo em Nome do SENHOR JESUS CRISTO com o ESPÍRITO SANTO escritas nas Escrituras Sagradas:- Salmos 33:12 - 144:15 - "Bem-aventurada é a Nação cujo DEUS é o SENHOR, e o Povo que ELE escolheu para sua Herança. Bem-aventurado o Povo a quem assim sucede! Bem-aventurado é o Povo cujo DEUS é o SENHOR."  ;;;;;;;
